import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from '../services/api';
import AdminStatsCard from '../components/AdminStatsCard';

const AdminDashboard = () => {
  // const [stats, setStats] = useState(null);
  // const [loading, setLoading] = useState(true);
  // const [error, setError] = useState(null);
  // const [recentActivity, setRecentActivity] = useState([]);

  // useEffect(() => {
  //   const fetchDashboardData = async () => {
  //     try {
  //       const [statsRes, activityRes] = await Promise.all([
  //         axios.get('/api/admin/dashboard/stats'),
  //         axios.get('/api/admin/dashboard/activity')
  //       ]);
        
  //       setStats(statsRes.data);
  //       setRecentActivity(activityRes.data);
  //     } catch (err) {
  //       setError(err.response?.data?.message || 'Failed to load dashboard data');
  //     } finally {
  //       setLoading(false);
  //     }
  //   };

  //   fetchDashboardData();
  // }, []);

  // if (loading) return <div>Loading dashboard...</div>;
  // if (error) return <div className="error">{error}</div>;

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>
      
      <div className="stats-grid">
        <AdminStatsCard 
          title="Pending Landlords" 
          // value={stats.pendingLandlords} 
          icon="👤" 
          link="/admin/pending-landlords"
          color="warning"
        />
        <AdminStatsCard 
          title="Pending Properties" 
          // value={stats.pendingProperties} 
          icon="🏠" 
          link="/admin/pending-properties"
          color="warning"
        />
        <AdminStatsCard 
          title="Total Landlords" 
          // value={stats.totalLandlords} 
          icon="👥" 
          link="/admin/landlords"
          color="info"
        />
        <AdminStatsCard 
          title="Total Tenants" 
          // value={stats.totalTenants} 
          icon="👥" 
          link="/admin/tenants"
          color="info"
        />
        <AdminStatsCard 
          title="Total Properties" 
          // value={stats.totalProperties} 
          icon="🏘️" 
          link="/admin/properties"
          color="success"
        />
      </div>

      <div className="quick-actions">
        <h2>Quick Actions</h2>
        <div className="actions-grid">
          <Link to="/admin/pending-landlords" className="action-card">
            <div className="action-icon">✅</div>
            <h3>Approve Landlords</h3>
          </Link>
          <Link to="/admin/pending-properties" className="action-card">
            <div className="action-icon">🏠</div>
            <h3>Review Properties</h3>
          </Link>
          <Link to="/admin/users" className="action-card">
            <div className="action-icon">👥</div>
            <h3>Manage Users</h3>
          </Link>
          <Link to="/admin/reports" className="action-card">
            <div className="action-icon">📊</div>
            <h3>View Reports</h3>
          </Link>
        </div>
      </div>

      <div className="recent-activity">
        <h2>Recent Activity</h2>
        <div className="activity-list">
          {/* {recentActivity.length > 0 ? (
            recentActivity.map((activity, index) => (
              <div key={index} className="activity-item">
                <p>{activity.message}</p>
                <span className="time">{new Date(activity.timestamp).toLocaleString()}</span>
              </div>
            ))
          ) : ( */}
            <p>No recent activity</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
